 private CDOStateMachine(){  init(CDOState.DIRTY, CDOEvent.DETACH_REMOTE, new ConflictTransition(CDOState.INVALID_CONFLICT)); init(CDOState.DIRTY, CDOEvent.RELOAD, new ReloadTransition());  init(CDOState.DIRTY, CDOEvent.COMMIT, new CommitTransition(true));  init(CDOState.DIRTY, CDOEvent.ROLLBACK, new RollbackTransition(CDOState.PROXY));  init(CDOState.PROXY, CDOEvent.PREPARE, FAIL);  init(CDOState.PROXY, CDOEvent.ATTACH, FAIL); } 
